import React from 'react';
import cover from './images/cover.png';
import logo from './images/logo.png';
import './App.css';

function App() {
  return (
    <div class="HomePage">
      <div class="Page">
        <div class="Container Column">
          <header class="NavBar">
            <a href="#">
              <h1 class="logo">
                <img src={logo} alt="Heaven Riders"></img>
              </h1>
            </a>
          </header>
          <div class="Hero">
            <div class="Heading">
              <div>Build Your</div>
            </div>

          </div>
        </div>
      </div>
    </div>    
  );
}

export default App;
